import React, {MouseEventHandler, ReactEventHandler} from 'react'
import './Button.styles.css'


interface ICommonButton {
	title: string
	path: string
	onClick?: (e: ReactEventHandler) => void
}
export const CommonButton: React.FC<ICommonButton>=({title, path}) => {
	return (
		<div className={"button-container"} >
			<a href={path}>{title}</a>
		</div>
	)
}
